import React from 'react';
const footer_logo = `${process.env.PUBLIC_URL}/img/footer-image.png`;

function Footer(props) {
    return (
        <div className='Footer'>
            <img src={footer_logo} className='Footer-Image' />
            <p className='Footer-Title'>
                MILK TEA POINT
            </p>
            <p className='Footer-Content'>
                Our Business Is Always The Way You Like.<br />
                We Don't Make Your Milk Tea.<br /> We Make Your Day.<br />
                We’re Not Just A Business.<br />
                We’re A Lifestyle.
            </p>
        </div>
    );
}

export default Footer;
